<section class="whydosec">

    <div class="container">

        <div class="whydocontainer">

            <div class="whydosechead">

                <h2>Why Do We</h2>

                <h2>Generate So Much E-Waste?</h2>

            </div>

            <div class="whydoboxes">

                <div class="row">

                    <div class="col-lg-3 col-md-3 col-sm-6 col-12 whycommbox">

                        <img src="assets/images/whydoicon1.png" alt="">

                        <div class="whydodetail">

                            <h3>Rapid Technological Advancements</h3>

                            <p>Newer and more advanced electronics are frequently introduced, making older models

                                obsolete.</p>

                        </div>

                    </div>

                    <div class="col-lg-3 col-md-3 col-sm-6 col-12 whycommbox">

                        <img src="assets/images/whydoicon2.png" alt="">

                        <div class="whydodetail">

                            <h3>Consumer Demand</h3>

                            <p>The constant desire for the latest gadgets leads to more frequent disposal of older

                                devices.</p>

                        </div>

                    </div>

                    <div class="col-lg-3 col-md-3 col-sm-6 col-12 whycommbox">

                        <img src="assets/images/whydoicon3.png" alt="">

                        <div class="whydodetail">

                            <h3>Planned Obsolescence</h3>

                            <p>Manufacturers often design products with a limited lifespan to encourage consumers to

                                replace them sooner.</p>

                        </div>

                    </div>

                    <div class="col-lg-3 col-md-3 col-sm-6 col-12 whycommbox">

                        <img src="assets/images/whydoicon4.png" alt="">

                        <div class="whydodetail">

                            <h3>Lack of Repair</h3>

                            <p>High costs and difficulty in repairing electronics push consumers to buy new items

                                instead of fixing old ones.</p>

                        </div>

                    </div>

                </div>

            </div>

        </div>

    </div>

</section>


