<section class="dontsec">

    <div class="container">

        <div class="dontseccontainer">

            <h3>Dos and Donts for E-Waste Generation</h3>

            <div class="row">

                <div class="col-lg-5 col-md-5 col-sm-5 col-12">

                    <div class="dontbox">

                        <h4><span><img src="assets/images/do.png" alt=""> </span>Dos</h4>

                        <ul>

                            <li><strong>Recycle Properly:</strong> Use certified e-waste recycling facilities to dispose

                                of electronic devices.</li>

                            <li><strong>Donate or Sell:</strong> If the device is still functional, consider donating or

                                selling it instead of discarding it.</li>

                            <li><strong>Repair and Reuse:</strong> Opt for repairing electronics rather than replacing

                                them to extend their lifespan.</li>

                            <li><strong>Educate Yourself:</strong> Stay informed about proper e-waste disposal methods

                                and local recycling programs.</li>

                        </ul>

                    </div>

                </div>

                <div class="col-lg-2 col-md-2 col-sm-2 col-12">

                    <div class="wasteicon h-100 d-flex align-items-center justify-content-center">

                        <img src="assets/images/waste-icon.png" alt="">

                    </div>

                </div>

                <div class="col-lg-5 col-md-5 col-sm-5 col-12">

                    <div class="dontbox">

                        <h4><span><img src="assets/images/dont.png" alt=""> </span>Donts</h4>

                        <ul>

                            <li><strong>Do Not Dump:</strong> Avoid throwing e-waste in regular trash bins as it can end

                                up in landfills, causing environmental harm.</li>

                            <li><strong>Do Not Incinerate:</strong> Burning e-waste releases toxic fumes and pollutants

                                into the air.</li>

                            <li><strong>Do Not Store Indefinitely:</strong> Accumulating old electronics at home can

                                pose health and safety risks due to potential leaks of hazardous substances.</li>

                            <li><strong>Do Not Ignore:</strong> Be proactive in finding sustainable ways to manage and

                                reduce e-waste.</li>

                        </ul>

                    </div>

                </div>

            </div>

        </div>

    </div>

</section>



