                            <p>Many consumers are unaware of the proper disposal methods for e-waste.</p>

                        </div>

                    </div>

                    <div class="challengesbox">

                        <div class="challengesimg">

                            <img src="assets/images/infrastructure.png" alt="">

                        </div>

                        <div class="challengesdetail">

                            <h4>Inadequate Infrastructure</h4>

                            <p>Many regions lack the necessary facilities and systems to collect and recycle e-waste

                                efficiently.</p>

                        </div>

                    </div>

                </div>

                <div class="col-lg-6 col-md-6 col-sm-6 col-12">

                    <div class="citywasteimg">

